description:
Joe Perry is the first solo album by Aerosmith guitarist Joe Perry, released on May 3, 2005 on Sony BMG. Joe Perry is his first solo album without The Joe Perry Project. The album peaked at #110 at the Billboard charts. Joe Perry was released as a regular CD and a DualDisc.

